import React, { Component } from 'react';
import PubSub from 'pubsub-js';

export default class Result extends Component {
    state = {
        list: {},
      }

    componentDidMount() {
        PubSub.subscribe('pictureMatch',(_,state)=>{
            this.setState({state})
        })
    }

    render() {
        const {list} = this.state
        return (<div>
            console.log({list.category.name});
        </div>

        );
    }
}
